import { withRouter } from 'next/router';

export default function Navbar() {
    return (
        <>
            <div>
                Objection
            </div>
            <ul>
                <li><a>Account</a></li>
                <li><a>World</a></li>
                <li><a>Tech</a></li>
                <li><a>Sports</a></li>
            </ul>
            <style jsx>{`
                div, ul {
                    position: relative;
                    z-index: 1;
                    left: 0;
                    box-sizing: border-box;
                    width: 100%;
                    height: 55px;
                    font-family: Verdana, sans-serif;
                    font-size: 20px;
                    padding: 14px 16px;
                    background-color: #f1f1f1;
                    box-shadow: 0px 4px 4px 0px #ddd;
                }
            `}</style>
        </>
    );
}
